import React, { Component } from 'react';
import './footer.css';

class Footer extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <footer className="main-footer">
                    <div className="container-fluid">
                        <div className="row">
                            <div className="col-lg-3 col-md-3">
                            </div>
                            <div className="col-lg-3 col-md-3">
                            </div>
                        </div>
                    </div>
                </footer>
            </React.Fragment>

         );
    }
}
 
export default Footer;
